///muestra la info que cada dog mapeado y nos da un link para ir al detalle de cada dog  


const Card =(props)=>{
    return (
        <div>
          <p>Image:{props.image}</p>
          <p>Name:{props.name}</p>
          <p>Weight:{props.weight}</p>
          <p>Height:{props.height}</p>
          <p>Temperament:{props.temperament}</p>


        </div>
    )

}

export default Card
